import React from "react";
import style from "./footer.module.css";

const Footer = () => {
    <div className={style.containerFooter}>
        <a className={style.link} href="https://github.com/GEdgardoFernandez">Github</a>
        <a className={style.link} href="https://www.linkedin.com/in/guillermo-fern%C3%A1ndez-703b50267">Linkedin</a>
    </div>
}

export default Footer;
